<html>
<head>
    <style>
        html, body {
            background: #eee;
            font-family: sans-serif;
        }
        .wrapper {
            position: relative;
            height: 99%;
            width: 99%;
        }
        #diagramDiv {
            position: absolute;
            top: 1em;
            bottom: 1em;
            left: 1em;
            right: 17em;
            background: white;
        }
        #buttonDiv {
            position: absolute;
            top: 1em;
            bottom: 1em;
            right: 1em;
            width: 13em;
            background: white;
            padding: 1em;
            text-align: center;
        }
        #buttonDiv h1 {
            font-size: 90%;
            font-weight: inherit;
            text-align: center;
            padding: 0.75em 0 0.1em;
            margin: 0;
        }
        #buttonDiv button {
            width: 31%;
            display: inline;
            text-align: center;
            line-height: 1.5;
            margin: 0.25em 0;
        }
    </style>
</head>
<body>

<div class="wrapper">
    <div id="diagramDiv"></div>
    <div id="buttonDiv">
        <h1>view angle</h1>
        <button type="button" onclick="set('isoAngle', Math.PI/4.5);">topdown</button>
        <button type="button" onclick="set('isoAngle', Math.PI/6);">normal</button>
        <button type="button" onclick="set('isoAngle', Math.PI/12);">side</button>

        <h1>block size</h1>
        <button type="button" onclick="set('blockSize', 1);">1&times;1m</button>
        <button type="button" onclick="set('blockSize', 5);">5&times;5m</button>
        <button type="button" onclick="set('blockSize', 10);">10&times;10m</button>
        <button type="button" onclick="set('blockSize', 20);">20&times;20m</button>

        <h1>vertical scale (shorter trees)</h1>
        <button type="button" onclick="set('scaleH', 1);">1:1</button>
        <button type="button" onclick="set('scaleH', 0.5);">1:2</button>
        <button type="button" onclick="set('scaleH', 0.25);">1:4</button>

        <h1>tree type</h1>
        <button type="button" onclick="set('treeType', 'pointy');">pointy</button>
        <button type="button" onclick="set('treeType', 'cylindrical');">cylinders</button>
        <button type="button" onclick="set('treeType', 'stump');">stump</button>
        <button type="button" onclick="set('treeType', 'combination');">combo</button>
        <button type="button" onclick="set('treeType', 'umbrella');">umbrella</button>
        <button type="button" onclick="set('treeType', 'random');">random</button>

        <h1>axes</h1>
        <button type="button" onclick="set('showAxes', true);">show</button>
        <button type="button" onclick="set('showAxes', false);">hide</button>

        <h1>airspace</h1>
        <button type="button" onclick="set('maxH', 50);">50m</button>
        <button type="button" onclick="set('maxH', 20);">20m</button>

    </div>
</div>

    var f;

    function draw() {

        f = new IsoWorld.Worlds.Forest('diagramDiv', config);

        f.autoRender(false);

        // set the altitude..
        var alt, groundLevel;
        for (var x = config.minX; x < config.maxX; x+=(config.blockSize/2)) {
            for (var y = config.minY; y < config.maxY; y+=(config.blockSize/2)) {
                alt = (Math.random() * 3);
                // alt = 0;
                groundLevel = new IsoWorld.Point(x, y, alt);
                f.ground(groundLevel);
            }
        }

        // f.ground(new IsoWorld.Point(wX-1, wY-1, wH));
        // f.ground(new IsoWorld.Point(0, 0, 0));

        // some points
        var points = [
            new IsoWorld.Point(               1, config.maxY*0.15, 0),
            new IsoWorld.Point(config.maxX*0.85, config.maxY*0.35, 0),
            new IsoWorld.Point(config.maxX*0.58, config.maxY*0.75, 0),
            new IsoWorld.Point(               1, config.maxY-1, 0)
        ]

        // set some paths
        f.path(points[2], '+x');
        f.path(points[2], '-y');

        // // set some ground stacks..
        // f.ground(points[0], ['water', 2, 'sand', 8, 'soil']);
        // f.ground(points[1], ['soil']);
        // f.ground(points[2], ['sand', 8, 'leaflitter', 12, 'soil']);
        // f.ground(points[3], ['leaflitter']);

        // // set some features..
        // f.feature(points[0]);
        // f.feature(points[1]);
        // f.feature(points[2]);
        // f.feature(points[3]);

        var t, tree;
        var TW, tH;
        for (var t=0; t < trees.length; t++) {
            tree = trees[t];
            // tree: x, y, diameter, height
            tW = tree.dbh2013a/100;
            if (tW )
            tH = tree.height2010;
            if (typeof tH != 'number' || tH == 0) {
                tH = tW * 30;
            }
            // f.tree(new IsoWorld.Point(tree.posX, tree.posY, 0), tW, tH);
        }

        f.render();

        window.document.body.style.cursor = 'auto';
    }

    function set(key, value) {
        window.document.body.style.cursor = 'wait';
        config[key] = value;
        draw();
    }
